INSERT INTO `user` (`id`, `about_me`, `admission_date`, `birth_date`, `coins`, `department`, `interests`, `password`, `position`, `profile_picture`, `role`, `technology`, `username`) VALUES
(0, NULL, NULL, NULL, NULL, NULL, NULL, '$2a$10$92LQQFcmi5Pkee2W25/2Ue6W9G0NQsFYQPii8x9vijFnnXHp6gHZG', NULL, NULL, 'ADMIN', NULL, 'Admin'),
(2, 'Atualmente estou a cursar Java presencialmente no ISCTE pelo programa UPskill (parceria com o IEFP). Minha intenção é ganhar experiência em linguagens de programação para desenvolver tanto softwares quanto sites mais complexos que possam facilitar a vida das pessoas.', '2025-02-20', '1988-03-28', 140, 'JURIDICO', 'CINEMA,SÉRIES,GAMES,MÚSICA,LEITURA', '$2a$10$kEKDsXRetA3TALC1HJGFaO/8.F7KDlxPyTnqthLTx5pbzv9kn.S9S', 'ADVOGADO', '/uploads/profile-pictures/f449ad48-48b3-4b4f-bcb4-435bf3fa2f70-20250603_132227.jpg', 'SENIOR', 'PROJURIS', 'Jeison'),
(52, 'Oi pessoal. Sou Keylla, a nova Gerente de RH Pleno na NTTData. Tenho mais de 7 anos de experiência na área de Recursos Humanos, focando em desenvolvimento organizacional e gestão de talentos. Estou animada para colaborar com todos vocês e promover um ambiente de trabalho positivo e produtivo. Contem comigo para o que precisarem!', '2025-02-20', '1984-05-24', 538, 'RH', 'CINEMA,SÉRIES,MÚSICA,VIAGENS,ANIMAIS', '$2a$10$fQtoq5NeBKMKhrUdj7T1QOr7f9fnUXWX1423ZjC4HN3Wy3EyK7wzC', 'GERENTE_RH', '/uploads/profile-pictures/484d8399-5df6-498a-af6e-738eb55eb550-Keylla.jpg', 'PLENO', 'WORKDAY', 'Keylla'),
(53, 'Sou Fernando Giovani.  Tenho uma sólida experiência no desenvolvimento de software e sou apaixonado por criar soluções inovadoras que realmente fazem a diferença. Gosto de desafios e de trabalhar em equipa, trocando ideias e aprendendo com os colegas. Espero contribuir com o meu conhecimento e, claro, também absorver muito do que vocês têm para compartilhar. Ansioso para essa nova jornada com vocês.', '2025-02-20', '2002-02-04', 260, 'TI', 'SÉRIES,GAMES,MÚSICA,LEITURA,ANIMAIS', '$2a$10$TYGfZAgE4IO.7N2RtqcyC.K3vQcYM6yy1yV3.sjec02apXIKDchsq', 'ARQUITETO_SOFTWARE', '/uploads/profile-pictures/be4d117a-ae3b-4da6-8c16-2c7e491bba7d-Fernando.jpg', 'SENIOR', 'PYTHON', 'Fernando'),
(102, 'Meu nome é Wilson Pontes, e é um prazer juntar-me ao grande time da NTTData. Estou animado para contribuir com a equipa. Contem comigo para colaborar e trocar conhecimentos! Ansioso para conhecer meus novos amigos!', '2025-02-20', '2000-01-01', 530, 'GERENCIA', 'SÉRIES,GAMES,MÚSICA,LEITURA,VIAGENS', '$2a$10$yrQE1Svj1YigC58vJtnCDesztYJO5WWl1pYAmpAQr5SgtvpkVJZ72', 'GERENTE_PROJETO', '/uploads/profile-pictures/5e3ba648-b7f0-414c-9aec-581f60a17423-Wilson.jpg', 'PLENO', 'JIRA', 'Wilson'),
(103, 'Sou um profissional de marketing experiente, com mais de 8 anos de expertise em planejamento de projetos, estratégias digitais e gestão de marcas. Tenho grande habilidade em liderar equipes multifuncionais, gerenciar fluxos de trabalho em CRM e otimizar campanhas em SEO, Google Ads e plataformas de redes sociais. Possuo um histórico comprovado de planejamento e execução de projetos internacionais, alcançando resultados por meio de organização, pensamento estratégico e inovação.', '2025-02-20', '2000-01-01', 632, 'MARKETING', 'ESPORTES,MÚSICA,LEITURA,VIAGENS,ANIMAIS', '$2a$10$kM3QViYHF.gwukBLKRSN6uLuebZBZrunnHleBr0wWLcPLIdMOD61u', 'GERENTE_MARKETING', '/uploads/profile-pictures/c02be46c-a186-4c49-a1c9-96e7e8c0c35a-Sara.jpg', 'SENIOR', 'ANALYTICS', 'Sara'),
(104, 'É sério que o JSON me colocou aqui? Sequer sou da NTT Data (não que eu não queira!). Espera, o Daniel é Diretor? Fogo! Deixa eu ver para onde fica a Brighten...', '2025-02-20', '2000-01-01', 18, 'MARKETING', 'ESPORTES,FOTOGRAFIA,MÚSICA,SÉRIES,GAMES', '$2a$10$FCsygN0ItxifuU7.ujixi.Dlabwmm75CRNR3QVUN4BGRHw7BocFeG', 'ANALISTA_MARKETING', '/uploads/profile-pictures/38d8b6dc-57ec-46b6-9b9c-3adb1a40a02f-Gonçalo.png', 'JUNIOR', 'SOCIALMEDIA', 'Gonçalo'),
(105, 'Olá, equipa da NTT Data! Sou a Diana Maçãs, e é com grande entusiasmo que me junto a vocês. Formei-me em Ciências da Comunicação pela Universidade Nova de Lisboa, onde desenvolvi uma sólida base em comunicação e marketing. Tenho experiência em gestão de redes sociais, criação de conteúdo e desenvolvimento de estratégias de marketing digital. Estou ansiosa por colaborar convosco, aprender e contribuir para o sucesso dos nossos projetos.', '2025-02-20', '2000-01-01', 181, 'GERENCIA', 'ESPORTES,MÚSICA,LEITURA,FOTOGRAFIA,VIAGENS', '$2a$10$zy7RqoqmZkeGKWFxwsrrK.A4H2Sr165nMOY6baHX8liCgWTk5eRgW', 'GERENTE_PRODUTO', '/uploads/profile-pictures/3c07e431-c617-4915-a6db-9cafce1c81be-Diana.jpg', 'PLENO', 'TRELLO', 'Diana Maçãs'),
(106, 'Sou Mário. Tenho vários anos de carreira em finanças. Ao longo da minha trajetória, participei em projetos de análise de dados e reporting em ambientes multinacionais. Acredito que esta experiência será valiosa na minha transição. Sou detalhista, adaptável, proativo e focado na melhoria contínua. Falo inglês e espanhol.', '2025-02-20', '2000-01-01', 440, 'FINANCEIRO', 'ESPORTES,MÚSICA,LEITURA,FOTOGRAFIA,VIAGENS', '$2a$10$2XAk9KxWsCjt4TR2w3n5AetmkyhTf2eFbC89.C7eoEmXaRgVMLRZu', 'CONTABILISTA', '/uploads/profile-pictures/f138b943-6cb4-48e8-ac50-26e709911b69-Mário.jpg', 'SENIOR', 'EXCEL', 'Mário'),
(107, 'Olá, caros colegas da NTTData! Sou Catarina. Estou sempre em busca de aprendizagem contínua e do desenvolvimento de novas tecnologias. Valorizo a colaboração em equipa e acredito que uma comunicação eficaz é essencial para o sucesso de qualquer projeto.', '2025-02-20', '2000-01-01', 564, 'FINANCEIRO', 'SÉRIES,MÚSICA,LEITURA,FOTOGRAFIA,ANIMAIS', '$2a$10$ScahG17HDA362eTTR0Dwke2WCz49z3OszNwDtUXmIsmdc2Dni1eym', 'CONTABILISTA', '/uploads/profile-pictures/e3aaa884-1259-44aa-8f6b-57111311d7d6-Catarina.jpg', 'PLENO', 'SAGE', 'Catarina'),
(108, 'Sou Diana, a nova Psicóloga na NTTData. Tenho vários anos de experiência ajudando empresas a cuidar do bem-estar dos colaboradores. Adoro criar e implementar programas de saúde mental, além de oferecer suporte individualizado. Estou animada para colaborar com todos vocês e promover um ambiente de trabalho saudável e acolhedor. Qualquer coisa, estou por aqui!', '2025-02-20', '2000-01-01', 25, 'RH', 'CINEMA,GAMES,LEITURA,VIAGENS,ANIMAIS', '$2a$10$WRG6oGdF3/GaX22GwTF0zOTmo1223UDQi/6u1dku7fsv8J2r0J16q', 'PSICOLOGO', '/uploads/profile-pictures/6ac34f9c-fad0-41dc-88d2-6bfa53eed746-Diana Clemente.jpg', 'PLENO', 'BAMBOO', 'Diana Clemente'),
(109, 'Com experiência em programação JAVA. Certificação profissional (Google) em análise de dados. Experiência em recolha de dados, organizar, filtrar e proficiente na utilização de tools como spreadsheets, SQL, Tableau, JAVA, Python e R. Excelentes competências para trabalhar em equipa, facilidade na comunicação e boas capacidades interpessoais. Experiência profissional como enfermeiro e nutricionista.  Licenciado em Enfermagem, Nutrição e certificação em Antropometria ISAK e Nutrição Avançada no Des', '2025-02-20', '2000-01-01', 108, 'TI', 'ESPORTES,GAMES,MÚSICA,VIAGENS,COZINHA', '$2a$10$h..s82462SW6yB.k7rDdEeTQMhABtI7opIW5j8PPZOPHg6hvYV2bO', 'ANALISTA', '/uploads/profile-pictures/df9da319-0fac-49b2-8bb8-ba622d11a2f7-Miguel.jpg', 'SENIOR', 'PYTHON', 'Miguel'),
(110, 'Oi equipe,\r\n\r\nSou Sofia Singh, nova integrante do RH na NTTData. Com mais de 8 anos de experiência, adoro criar ambientes de trabalho positivos e apoiar o desenvolvimento dos colaboradores. Estou animada para colaborar com todos e promover uma cultura organizacional forte e saudável.\r\n\r\nContem comigo para o que precisarem!', '2025-02-20', '2000-01-01', 80, 'RH', 'GAMES,MÚSICA,LEITURA,VIAGENS,ANIMAIS', '$2a$10$/loeCqGkfzmHd2ygUWslleFj1q7wLMCo9sFRAdHeTXjE3cxCDkEvq', 'RECRUTADOR', '/uploads/profile-pictures/2da0e285-6213-4860-916e-a838a32a1f7d-Sofia.jpg', 'PLENO', 'WORKDAY', 'Sofia'),
