(152, 'Daniel Fernandes, 30 anos, PhD em Ciência e Tecnologia da Informação. Seis meses de experiência em desenvolvimento full-stack Java e várias publicações científicas sobre telecomunicações e redes 5G. Atualmente, Professor Assistente na Universidade Lusófona.', '2025-02-20', '2000-01-01', 936, 'DIRETORIA', 'CINEMA,LEITURA,VIAGENS,COZINHA,ANIMAIS', '$2a$10$WaB3c7Al56eKkN/GTERSEe0uW3xNWT7h/II7SoZQv7aSf0w8.xbnK', 'DIRETOR', '/uploads/profile-pictures/92272a04-09b8-4f92-b80f-6bd08bae0888-Daniel.jpg', 'SENIOR', 'POWERBI', 'Daniel'),
