(154, 'Sou João Antão, o novo Diretor Sénior na NTTData, especializado em programação concorrente. Tenho mais de 15 anos de experiência na área e adoro enfrentar desafios complexos, sempre buscando soluções inovadoras. Estou muito animado para colaborar com todos vocês e contribuir para o sucesso dos nossos projetos.', '2025-02-20', '2000-01-01', 751, 'DIRETORIA', 'ESPORTES,MÚSICA,VIAGENS,COZINHA,ANIMAIS', '$2a$10$JX5TwCYwaTf8oMOiyQKf.u97LKxpnt8bAFQaVar9lrXnap7FjDDMO', 'DIRETOR', '/uploads/profile-pictures/7217d84a-fe83-4ee0-9ec3-084b7aaf985d-João.jpg', 'SENIOR', 'SALESFORCE', 'João'),
(155, 'Oi, sou Pedro Romano. Transformo as ideias de produtos digitais dos nossos clientes em realidade. Também sou Professor Universitário nas áreas de programação, empreendedorismo e inovação, com algumas publicações de pesquisa em IA e Machine Learning.', '2025-02-20', '2000-01-01', 852, 'DIRETORIA', 'CINEMA,SÉRIES,MÚSICA,LEITURA,FOTOGRAFIA', '$2a$10$Oe50c1CUgePS7Ljv.q8Tn.V3lh9g3nxPGeRZBK28kdbDoOsEsTXKO', 'DIRETOR_EXECUTIVO', '/uploads/profile-pictures/f59fa313-2caf-45e0-be78-e6fe5c5d7833-Pedro.jpg', 'SENIOR', 'TABLEAU', 'Pedro'),
(156, 'Sou uma profissional multi-tasking com muitas experiências funcionais cruzadas, desenvolvidas no meu percurso académico e profissional. Durante a minha experiência profissional, tive a oportunidade de coordenar e implementar projetos europeus, gerir equipas de trabalho com orientação para resultados e recrutar e capacitar colaboradores. Assim como operacionalizar estratégias de vendas, consultoria, estudos de mercado, e auditoria de segurança e imagem.', '2025-02-20', '2000-01-01', 999, 'DIRETORIA', 'CINEMA,SÉRIES,LEITURA,VIAGENS,ANIMAIS', '$2a$10$cQ.bvyhxhBgO8sxGnh86JO7zGkg3PXMab5MGstvp7UkD43UWlo5Ui', 'DIRETOR', '/uploads/profile-pictures/71303f14-c101-4761-b7fc-397799f84605-Raquel Felix.jpg', 'SENIOR', 'POWERBI', 'Raquel Félix');

